package SlidingWindow;

import java.util.HashMap;

/**
 * 76. 最小覆盖子串
 */
public class MinimumWindowSubstring {
    /**
     *
     * 给滑动窗口维护2个变量：
     * 1。一个哈希表：存储在t里出现过的字符及其次数, 只存储在need中出现过的字符，避免存储无用的字符
     * 2。一个有效字符个数：跟t中的字符次数一致的字符个数。从而可以在滑动窗口在s上滑动时，O(1)去判断是否覆盖。
     *
     * 空间复杂度：O(c)，c为t的字符集大小
     * 时间复杂度：O(m+n), m、n分别是2个字符的长度大小
     */
    public String minWindow(String s, String t) {
        int n = s.length();
        // need存储需要找的字符及对应次数
        HashMap<Character, Integer> need = new HashMap<>();
        // win存储窗口内合法的字符及对应次数
        HashMap<Character, Integer> win = new HashMap<>();
        for (char c: t.toCharArray()){
            need.put(c, need.getOrDefault(c, 0) + 1);
        }

        int l = 0;
        int r = 0;
        int start = 0;
        int minLen = Integer.MAX_VALUE;
        // valid表示跟need里次数相同的字符个数
        int valid = 0;
        while (r < n){
            // 右移右边界
            char c = s.charAt(r++);
            // 针对移入窗口的元素，更新win和valid的状态
            if (need.containsKey(c)){
                win.put(c, win.getOrDefault(c, 0) + 1);
//                if (need.get(c) == win.get(c)) { // TODO:这个==在大的字符串的测试用例时是错的，通过不了，为什么？
                if (need.get(c).equals(win.get(c))) { // 次数相等时更新valid
                    valid++;
                }
            }

            // 缩小窗口条件：已经覆盖，即：valid字符数等于need大小
            // 由于win里只存储need中有的字符，且只有字符次数相等时valid才计数，所以valid和need大小相同时，即为覆盖
            while (valid == need.size()){
                // 判断是否最短
                System.out.printf("window: [%d, %d]%n", l, r);
                if (r - l < minLen){  // 左闭右开
                    minLen = r - l;
                    start = l;
                }
                // 右移左边界
                char d = s.charAt(l++);
                // 针对移除窗口的元素，恢复win、valid状态
                if (need.containsKey(d)){
                    win.put(d, win.get(d) - 1);
                    // 因为win里的某个字符次数，可能大于need中的字符次数
                    // 只有win里的某个字符的个数小于need中的对应字符，才更新valid
                    if (win.get(d) < need.get(d)) {
                        valid--;
                    }
                }
            }
        }

        return minLen == Integer.MAX_VALUE ? "" : s.substring(start, start + minLen);
    }

    public static void main(String[] args) {
        MinimumWindowSubstring inst = new MinimumWindowSubstring();
//        System.out.println(inst.minWindow("ADOBECODEBANC", "ABC"));
//        System.out.println(inst.minWindow("a", "a"));
//        System.out.println(inst.minWindow("a", "aa"));

        String s = "";
        String t = "";

        System.out.println(inst.minWindow(s, t));
    }
}
